import React from "react";

export const ContactForm = ({
  name,
  setName,
  phone,
  setPhone,
  email,
  setEmail,
  handleSubmit
}) => {
  return (
    <>
      <form onSubmit={handleSubmit}>
        <input type="text" name="name" placeholder="Name" onChange={setName} />
        <input type="text" name="phone" placeholder="Phone" onChange={setPhone} />
        <input type="text" name="email" placeholder="Email" onChange={setEmail} />
        <button type="submit">Submit</button>
      </form>
    </>
  );
};
